import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';

// User components
import Navbar from './components/Navbar';
import Login from './components/Login';
import Register from './components/Register';
import Dashboard from './components/Dashboard';
import ContactForm from './components/ContactForm';
import DiabetesForm from './components/PredictionForms/DiabetesForm';
import HeartForm from './components/PredictionForms/HeartForm';

// Admin components
import AdminLogin from './admin/AdminLogin';
import AdminLayout from './admin/AdminLayout';
import AdminDashboard from './admin/AdminDashboard';
import UserManagement from './admin/UserManagement';
import MessagesManagement from './admin/MessagesManagement';
import AuditLogs from './admin/AuditLogs';
import HospitalMap from './components/HospitalMap';

// Protected Route Component
const ProtectedRoute = ({ children }) => {
  const token = localStorage.getItem('token');
  return token ? children : <Navigate to="/login" />;
};

const AdminProtectedRoute = ({ children }) => {
  const adminToken = localStorage.getItem('adminToken');
  return adminToken ? children : <Navigate to="/admin/login" />;
};

function App() {
  return (
    <Router>
      <Routes>
        {/* User Routes */}
        <Route path="/" element={
          <>
            <Navbar />
            <div className="container">
              <div className="hero">
                <h1>Smart Health Diagnosis System</h1>
                <p>AI-powered disease prediction for better healthcare</p>
              </div>
            </div>
          </>
        } />
        
        <Route path="/login" 
        element={
        <>
        <Navbar />
        <Login />
        </>
      } />
        <Route path="/register" element={<><Navbar /><Register /></>} />
        <Route path="/contact" element={<><Navbar /><ContactForm /></>} />
        
        <Route path="/dashboard" element={
          <ProtectedRoute>
            <Navbar />
            <Dashboard />
          </ProtectedRoute>
        } />
        
        <Route path="/predict/diabetes" element={
          <ProtectedRoute>
            <Navbar />
            <DiabetesForm />
          </ProtectedRoute>
        } />
        
        <Route path="/predict/heart" element={
          <ProtectedRoute>
            <Navbar />
            <HeartForm />
          </ProtectedRoute>
        } />

        {/* Admin Routes */}
        <Route path="/admin/login" element={<AdminLogin />} />
        
        <Route path="/admin" element={
          <AdminProtectedRoute>
            <AdminLayout />
          </AdminProtectedRoute>
        }>
          <Route path="map" element={<HospitalMap />} />
          <Route path="dashboard" element={<AdminDashboard />} />
          <Route path="users" element={<UserManagement />} />
          <Route path="messages" element={<MessagesManagement />} />
          <Route path="audit-logs" element={<AuditLogs />} />
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
